let data = {
    reviews: [
        {
            userId: 'Tom',
            id: 1,
            title: "Good product",
            body: "I liked this product so much."
        },
        {
            userId: 'Stephanie',
            id: 2,
            title: "Medium quality product",
            body: "I liked this product but it has some bugs."
        },
        {
            userId: 'Megan',
            id: 3,
            title: "Don't like it",
            body: "it didn't work."
        },
    ]
}

export default data;
